import React from 'react';
import { Link } from 'react-scroll';

const NavItem = ({ link }) => {
  return (
    <Link to={link.name} smooth={true} duration={500}>
      <a href={link.path}>{link.display}</a>
    </Link>
  );
};

export default NavItem;
